import React, { useState } from "react";
import jsPDF from "jspdf";
import "../styles.css";

const MitigationForm = () => {
  const [formData, setFormData] = useState({
    customerName: "",
    jobAddress: "",
    claimNumber: "",
    insuranceCompany: "",
    technicianName: "",
    rooms: [],
    psychrometrics: {
      tempIn: "",
      tempOut: "",
      rhIn: "",
      rhOut: ""
    },
    paymentStatus: "",
    notes: ""
  });

  const [room, setRoom] = useState({ name: "", moisture: "", equipment: "", notes: "" });

  const addRoom = () => {
    setFormData(prev => ({ ...prev, rooms: [...prev.rooms, room] }));
    setRoom({ name: "", moisture: "", equipment: "", notes: "" });
  };

  const generateAI = () => {
    alert("ðŸ”œ AI Summary Coming Soon! (ServiceTitan format + Insurance wording)");
  };

  const generatePDF = () => {
    const doc = new jsPDF();
    doc.setFont("helvetica", "bold");
    doc.setFontSize(18);
    doc.text("ðŸ›  ToolbeltAI Mitigation Report", 10, 10);

    doc.setFontSize(12);
    doc.text(`Customer: ${formData.customerName}`, 10, 20);
    doc.text(`Job Address: ${formData.jobAddress}`, 10, 30);
    doc.text(`Claim #: ${formData.claimNumber}`, 10, 40);
    doc.text(`Insurance: ${formData.insuranceCompany}`, 10, 50);
    doc.text(`Technician: ${formData.technicianName}`, 10, 60);

    let yPos = 75;
    doc.setFont(undefined, "bold");
    doc.text("ROOM READINGS", 10, yPos);

    formData.rooms.forEach((r, i) => {
      yPos += 10;
      doc.setFont(undefined, "bold");
      doc.text(`${i + 1}) ${r.name}`, 10, yPos);
      doc.setFont(undefined, "normal");
      doc.text(`Moisture: ${r.moisture}`, 10, yPos + 10);
      doc.text(`Equipment: ${r.equipment}`, 10, yPos + 20);
      doc.text(`Notes: ${r.notes}`, 10, yPos + 30);
      yPos += 40;
    });

    // Psychrometric Section
    yPos += 20;
    doc.setFont(undefined, "bold");
    doc.text("PSYCHROMETRIC DATA", 10, yPos);

    doc.setFont(undefined, "normal");
    doc.text(`Temp In: ${formData.psychrometrics.tempIn}`, 10, yPos + 10);
    doc.text(`Temp Out: ${formData.psychrometrics.tempOut}`, 10, yPos + 20);
    doc.text(`RH In: ${formData.psychrometrics.rhIn}`, 10, yPos + 30);
    doc.text(`RH Out: ${formData.psychrometrics.rhOut}`, 10, yPos + 40);

    doc.save("ToolbeltAI_Mitigation_Report.pdf");
  };

  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  return (
    <div className="container">

      <h1 className="title">ToolbeltAI Mitigation Daily Log â€“ Demo</h1>

      {/* Customer Section */}
      <section className="section">
        <h3>ðŸ“Œ Customer & Job Info</h3>
        <input name="customerName" placeholder="Customer Name" onChange={handleChange} />
        <input name="jobAddress" placeholder="Job Address" onChange={handleChange} />
        <input name="claimNumber" placeholder="Claim Number" onChange={handleChange} />
        <input name="insuranceCompany" placeholder="Insurance Company" onChange={handleChange} />
        <input name="technicianName" placeholder="Technician Name" onChange={handleChange} />
      </section>

      {/* Room Section */}
      <section className="section">
        <h3>ðŸ“· Add Rooms & Moisture Readings</h3>
        <input placeholder="Room Name" onChange={e => setRoom({ ...room, name: e.target.value })} />
        <input placeholder="Moisture Reading" onChange={e => setRoom({ ...room, moisture: e.target.value })} />
        <input placeholder="Equipment Used" onChange={e => setRoom({ ...room, equipment: e.target.value })} />
        <textarea placeholder="Room Notes" onChange={e => setRoom({ ...room, notes: e.target.value })}></textarea>
        <button className="btn-secondary" onClick={addRoom}>âž• Add Room</button>
      </section>

      {/* Psychrometrics */}
      <section className="section">
        <h3>ðŸ“Š Psychrometric Data</h3>
        <input name="tempIn" placeholder="Temp In (Â°F)" onChange={e => setFormData({ ...formData, psychrometrics: { ...formData.psychrometrics, tempIn: e.target.value } })} />
        <input name="tempOut" placeholder="Temp Out (Â°F)" onChange={e => setFormData({ ...formData, psychrometrics: { ...formData.psychrometrics, tempOut: e.target.value } })} />
        <input name="rhIn" placeholder="RH In (%)" onChange={e => setFormData({ ...formData, psychrometrics: { ...formData.psychrometrics, rhIn: e.target.value } })} />
        <input name="rhOut" placeholder="RH Out (%)" onChange={e => setFormData({ ...formData, psychrometrics: { ...formData.psychrometrics, rhOut: e.target.value } })} />
      </section>

      {/* Buttons */}
      <button className="btn-primary" onClick={generateAI}>ðŸ§  Generate AI Summary</button>
      <button className="btn-primary" onClick={generatePDF}>ðŸ“„ Export PDF</button>
    </div>
  );
};

export default MitigationForm;
